    Fund and Democratic National Committee are offsets for the payment of rent. The
    Democratic Party of Oregon shares office space with several organizations. We
    write one check to pay rent. The amount of rent paid by each organization is assessed
    at the usual and normal charge, determinined by the amount of space occupied by
    the organization. Schedule A Line 15 reflects receipts from various County party
    committees. The Democratic Party of Oregon offers our County Committees a number
    of technology services at cost.  These sevices include website and email services.
    Payments for salaries and wages reported on Schedule H4 are for employees who
    spent less than 25% of their time on FEA or activities in connection with a Federal
    election. Employees who spend more than 25% of their time on FEA or activities
    in connection with a Federal election are paid with 100% Federal funds as are
    their fringe benefits and reported on Line 30b.  The DPO Treasurer and Compliance
    Director attended the recent FEC conference in San Francisco. One issue discussed
    was the need to review accounts for transactionns that will never clear and report
    the purging of same. This report includes the reversal/voidance of  several transactions.
